import React from "react";

import './css/Education.css'
import { BiCodeCurly, BiBookOpen } from "react-icons/bi";

class Education extends React.Component {

  render() {

    const iconsColor = '#49a572';
    const iconsSize = '20px';

    return (
      <div className='WideSection'>
        <div>
          <strong className="Titles MainTitle">Education</strong>
        </div>
        <div>
        <p>
          Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Donec quis nibh at felis congue commodo. Nullam sit amet magna in magna gravida vehicula. Nulla est. Mauris dictum facilisis augue. Duis risus. Nulla accumsan, elit sit amet varius semper, nulla mauris mollis quam, tempor suscipit diam nulla vel leo. In rutrum. Ut tempus purus at lorem. Pellentesque habitant morbi tristique senectus et netus et malesuada fames ac turpis egestas. Etiam dui sem, fermentum vitae, sagittis id, malesuada in, quam. Maecenas lorem.
        </p>
        <p>
          <strong className="Titles SubTitle">Zkusenosti</strong><BiBookOpen color={iconsColor} size={iconsSize}/>
          <ul>
            <li>Vypocestni slozitost algoritmu</li>
            <li>Znalost datovych struktur</li>
            <li>Projekty na skole CVUT FEL, 2 roky</li>
            <li>Projekty na skole Unicorn University, 3 roky</li>
            <li>Agilni vs. tradicni rizeni projektu</li>
            <li>.NET developer, 3 roky</li>
          </ul>
        </p>
        </div>
      </div>
    );
  }
}

export default Education;
